import "./Button.css";
import MyImage from '../../icon-play.png';

const Button = ({ active, text, imgPath, ...btnProps }) => {

  return (
    <button
      className={active ? ".btn-active" : "btn-disabled"}
      {...btnProps}
    >
      <img src={MyImage} width="30" />
      {text}
    </button>
  );
};

export default Button;
